import { Grid, TextField } from '@material-ui/core';

const SignUp = () => {
	return (
		<Grid 
			container 
			spacing={2} 
			lg={10}   
			// direction="row"
			justifyContent="center"
			alignItems="center"
		>
			<Grid item xs={10} sm={4} style={{ padding : '10px' }}>
				<TextField 
					id="outlined-basic" 
					label="first name" 
					variant="outlined" 
					helperText="Please enter your first name"
					style={{ width : '80%' }}
					margin = 'normal'
				/>
			</Grid>
			<Grid  item xs={10} sm={4} style={{ padding : '10px' }}>
				<TextField 
					id="outlined-basic" 
					label="last name" 
					variant="outlined"
					helperText="Please enter your last name"
					style={{ width : '80%' }}
					margin = 'normal'
					// size="small"
				/>
			</Grid>		
		</Grid>
	);
};

export default SignUp;
